import classes from "./MealItemForm.module.css";
function MealItemForm(props) {
  return (
    <form>
      <label htmlFor={props.id} />
      <input id={props.id} type="amount" min='1' max="5" step='1' defaultValue='1'></input>
      <button>+ Add</button>
    </form>
  );
}
export default MealItemForm;
